css:
@-moz-document url-prefix("https://www.roblox.com"), url-prefix("https://web.roblox.com") {
@keyframes header-pink {
       0% {
              border-color: #fb9bb9;
       }
       14% {
              border-color: #fb9bb9;
       }
       28% {
              border-color: #fb9bb9;
       }
       42% {
              border-color: #fb9bb9;
       }
       56% {
              border-color: #fb9bb9;
       }
       80% {
              border-color: #fb9bb9;
       }
       94% {
              border-color: #fb9bb9;
       }
       100% {
              border-color: #fb9bb9;
       }
}
.rbx-header {
       animation: header-pink 13s infinite;
}
}
